    [],nt"revision_timestamp": "2016-02-26T22:15:51.441723",nt"name": "afsc-nmml-small-cetacean-aerial-survey-in-alaskan-waters-1997-1999-dbe04",nt"isopen":
    false,nt"url": null,nt"notes": "Aerial surveys were conducted to produce
    abundance estimates for the three Alaska stocks of harbor porpoise. Surveys occurred
    from May to July 1997 for the Southeast Alaska stock, May to July 1998 for the Gulf
    of Alaska stock, and June to July 1999 for the Bering Sea stock. Two primary observers
    observed from bubble windows on the left and right side of the plane. A belly window
    observer with a view directly down along the trackline collected sightings that
    were matched to the side observers and used to estimate a correction factor for
    perception bias that was specific to harbor porpoise in Alaskan waters.",nt"license_title":
